import LArrowIcon from "../icons/larrow";
import RArrowIcon from "../icons/rarrow";

function Slider(props) {
  const position = {};
  const design = {};

  return (
    <>
      <Topbar heading={props.heading} subheading={props.subheading} />
    </>
  );
}

function Topbar(props) {
  const position = {
    buttonwrapper: "flex items-center gap-3",
    container: "flex justify-between mt-10",
    larrow: "p-2.5",
    rarrow: "p-2.5",
  };
  const design = {
    heading: "text-2xl",
    larrow: "bg-gray-100 text-gray-300 rounded-3xl",
    larrowactive: "",
    rarrow: "bg-gray-100 text-gray-300 rounded-3xl",
    larrowactive: "",
  };

  return (
    <div className={position.container}>
      <h3 className={design.heading}>{props.heading}</h3>
      <div className={position.buttonwrapper}>
        <h3>{props.subheading}</h3>
        <div className={`${position.larrow} ${design.larrow}`}>
          <LArrowIcon />
        </div>
        <div className={`${position.rarrow} ${design.rarrow}`}>
          <RArrowIcon />
        </div>
      </div>
    </div>
  );
}

export default Slider;
